import React, {useState} from 'react';

const List = () => {

    const [list, setList] = useState([
        "1. Встать",
        "2. Поесть",
        "3. Учиться",
    ]);

    return (
        <div>
            {list.map((item) => (
                <p>{item}</p>
            ))}
        </div>
    );
};

export default List;
